/* FONT AWESOME */
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faAngleDown, faSearch} from '@fortawesome/free-solid-svg-icons';
/* ============ */
/* HOOKS */
import { useSelector } from 'react-redux';
/* ============ */
const Links = () =>{
    return(
        <div className='links flex-center links-mobile active'>
            <ul className="flex-center">
                <li><a className='active' href='/'>Home</a></li>
                <li><a href='/'>About</a></li>
                <li className='services-menu-link'>
                    <a href='/'>Services <FontAwesomeIcon icon={faAngleDown} /></a>
                    <ul className='services-menu'>
                        <li><a href='/'>View All</a></li>
                        <li><a href='/'>Design & Planning</a></li>
                        <li><a href='/'>Interior Design</a></li>
                        <li><a href='/'>Exterior Design</a></li>
                        <li><a href='/'>Construction Drawings</a></li>
                    </ul>
                </li>
                <li><a href='/'>Blogs</a></li>
                <li><a href='/'>Contact</a></li>
                <li><a href='#/'><FontAwesomeIcon icon={faSearch} /></a></li>
            </ul>
        </div>
    );
}
export default Links;
